/*!40101 SET NAMES utf8 */;
/*!40014 SET FOREIGN_KEY_CHECKS=0 */;
/*!40101 SET SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */;
/*!40111 SET SQL_NOTES=0 */;
CREATE DATABASE /*!32312 IF NOT EXISTS*/ movies /*!40100 DEFAULT CHARACTER SET utf8mb4 */;
USE movies;

DROP TABLE IF EXISTS directors;
CREATE TABLE `directors` (
  `DIR_ID` varchar(10) NOT NULL,
  `DIR_NAME` varchar(200) DEFAULT NULL,
  `DIR_GENDER` char(20) DEFAULT NULL,
  PRIMARY KEY (`DIR_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS genres;
CREATE TABLE `genres` (
  `GENRE_TITLE` varchar(50) DEFAULT NULL,
  `GENRE_ID` varchar(10) NOT NULL,
  PRIMARY KEY (`GENRE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS movie_direction;
CREATE TABLE `movie_direction` (
  `MOV_ID` varchar(10) NOT NULL,
  `DIR_ID` varchar(10) NOT NULL,
  PRIMARY KEY (`MOV_ID`,`DIR_ID`),
  KEY `DIR_ID` (`DIR_ID`),
  CONSTRAINT `movie_direction_ibfk_1` FOREIGN KEY (`MOV_ID`) REFERENCES `moviesdata` (`MOV_ID`),
  CONSTRAINT `movie_direction_ibfk_2` FOREIGN KEY (`DIR_ID`) REFERENCES `directors` (`DIR_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS movie_genres;
CREATE TABLE `movie_genres` (
  `MOV_ID` varchar(10) NOT NULL,
  `GENRE_ID` varchar(10) NOT NULL,
  PRIMARY KEY (`MOV_ID`,`GENRE_ID`),
  KEY `GENRE_ID` (`GENRE_ID`),
  CONSTRAINT `movie_genres_ibfk_1` FOREIGN KEY (`GENRE_ID`) REFERENCES `genres` (`GENRE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS moviecast;
CREATE TABLE `moviecast` (
  `CAST_ID` varchar(10) NOT NULL,
  `DIR_ID` varchar(10) DEFAULT NULL,
  `ACT1_ID` varchar(10) DEFAULT NULL,
  `ACT1_NAME` varchar(100) DEFAULT NULL,
  `ACT1_GENDER` char(1) DEFAULT NULL,
  `ACT2_ID` varchar(10) DEFAULT NULL,
  `ACT2_NAME` varchar(100) DEFAULT NULL,
  `ACT2_GENDER` char(1) DEFAULT NULL,
  `ACT3_ID` varchar(10) DEFAULT NULL,
  `ACT3_NAME` varchar(100) DEFAULT NULL,
  `ACT3_GENDER` char(1) DEFAULT NULL,
  PRIMARY KEY (`CAST_ID`),
  KEY `DIR_ID` (`DIR_ID`),
  CONSTRAINT `moviecast_ibfk_1` FOREIGN KEY (`DIR_ID`) REFERENCES `directors` (`DIR_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS moviesdata;
CREATE TABLE `moviesdata` (
  `MOV_ID` varchar(10) NOT NULL,
  `MOV_TITLE` varchar(250) DEFAULT NULL,
  `MOV_YEAR` int DEFAULT NULL,
  `MOV_LANG` varchar(12) DEFAULT NULL,
  `DIR_ID` varchar(10) DEFAULT NULL,
  `MOV_DURATION` int DEFAULT NULL,
  `MOV_CAST_ID` varchar(10) DEFAULT NULL,
  `MOV_GENRE_ID` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`MOV_ID`),
  KEY `DIR_ID` (`DIR_ID`),
  KEY `MOV_GENRE_ID` (`MOV_GENRE_ID`),
  KEY `MOV_CAST_ID` (`MOV_CAST_ID`),
  CONSTRAINT `moviesdata_ibfk_1` FOREIGN KEY (`DIR_ID`) REFERENCES `directors` (`DIR_ID`),
  CONSTRAINT `moviesdata_ibfk_2` FOREIGN KEY (`MOV_GENRE_ID`) REFERENCES `genres` (`GENRE_ID`),
  CONSTRAINT `moviesdata_ibfk_3` FOREIGN KEY (`MOV_CAST_ID`) REFERENCES `moviecast` (`CAST_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS performance;
CREATE TABLE `performance` (
  `MOV_ID` varchar(10) DEFAULT NULL,
  `RATINGS` float(10,2) DEFAULT NULL,
  `REVENUE` float(10,5) DEFAULT NULL,
  `NO_OF_AWARDS` int DEFAULT NULL,
  KEY `MOV_ID` (`MOV_ID`),
  CONSTRAINT `performance_ibfk_1` FOREIGN KEY (`MOV_ID`) REFERENCES `moviesdata` (`MOV_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE OR REPLACE VIEW `new_view` AS select `genres`.`GENRE_TITLE` AS `GENRE_TITLE`,`genres`.`GENRE_ID` AS `GENRE_ID` from `genres`;

